import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './styles/about.less';

class About extends Component {
  render() {
    return (
      <div className="about-wrapper">
        <img src="./img/me.svg" />
      </div>
    );
  }
}

export default About;
